import React, { Component } from 'react';
import styled from 'styled-components';

export const PassoEsquerda = styled.div`
width: 100%;
video {
    float: left;
}

> div {
    float: left;
    > h3{
        float: left;
    }
}

`;

export const PassoDireita = styled.div`
video {
    float: right;
}

> div {
    float: left;
}
> div.h3{
    float: left;
}
`;

const Wrapper = styled.div`

padding: 0 120px;

`;

class PassoApasso extends Component {
    render() {
        return (
            <Wrapper>
                <PassoEsquerda>
                    <iframe src="https://www.youtube.com/embed/pVE92TNDwUk" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen>

                    </iframe>
                    <div>
                        <h3>asdads</h3>
                        <span>adsads</span>
                        <a href="#"></a>
                    </div>

                </PassoEsquerda>
                <PassoDireita></PassoDireita>
            </Wrapper>
        );
    }
}

export default PassoApasso;
